function getColor(d) {
    return d > 23000000 ? '#e6ae48' :
          
           d > 14000000   ? '#6BBAA7' :
          
           d > 5000000   ? '#828081' :
                      '#945d60';
}



function style(feature) {
    return {
        fillColor: getColor(feature.properties.Natusers),
        weight: 2,
        opacity: 1,
        color: 'white',
        dashArray: '3',
        fillOpacity: 0.7

    };
}

L.geoJson(Amer, { style: style }).addTo(map);




var geojson;

function highlightFeature(e) {
    var layer = e.target;

    layer.setStyle({
        weight: 5,
        color: 'black',
        dashArray: '',
        fillOpacity: 0.7,
        
        fillColor: 'rgba(0,0,0,0.2'
    });

    if (!L.Browser.ie && !L.Browser.opera) {
        layer.bringToFront();
    }
    info.update(layer.feature.properties);
}

function resetHighlight(e) {
    geojson.resetStyle(e.target);
    info.update();
    

    
}



// ... our listeners


function zoomToFeature(e) {
    map.fitBounds(e.target.getBounds());
   

}

function onEachFeature(feature, layer) {
    layer.bindPopup('<label>User In this counrty : </label><h1>' + layer.feature.properties.Natusers.toLocaleString() + '</h1><br>' + '<label>Ranking </label><h1>' + layer.feature.properties.ordning + '</h1>'.toString())
    layer.on({
        mouseover: highlightFeature,
        mouseout: resetHighlight,
       // click: zoomToFeature 
        

    });
   
}
geojson = L.geoJson(Amer);

geojson = L.geoJson(Amer, {
    style: style,
    onEachFeature: onEachFeature
}).addTo(map);



var info = L.control();

info.onAdd = function (map) {
    this._div = L.DomUtil.create('div', 'info'); // create a div with a class "info"
    this.update();
    return this._div;
};

// method that we will use to update the control based on feature properties passed
info.update = function (props) {
    this._div.innerHTML = '<h4>Internet Users in Middle East &  North Africa</h4>' +  (props ?
        '<b>' + props.SOVEREIGNT + '</b><br />' + props.Natusers.toLocaleString() 
        : 'Hover over or click a Country');
};

info.addTo(map);


